import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="Sidebar">
      <h2>Upcoming Events</h2>
      <div className="event" id="event-feb">
        <div className="event-date">FEB<br />14</div>
        <div className="event-name">Valentines Chocolate Signup Form</div>
      </div>
      <div className="event" id="event-mar">
        <div className="event-date">MAR<br />10</div>
        <div className="event-name">Movie Night Signup Form</div>
      </div>
      <div className="event" id="event-apr">
        <div className="event-date">APR<br />24</div>
        <div className="event-name">Bowling Night Signup Form</div>
      </div>
    </div>
  );
}

export default Sidebar;
